import { useState, useEffect, React } from "react";
import axios from "axios";

const SolInstEvents = ({ solInst }) => {
  const [solInstsEvents, setSolInstsEvents] = useState([]);

  useEffect(() => {
    fetchSolInstsEvents();
  }, []);

  const fetchSolInstsEvents = async () => {
    await axios
      .post("http://localhost:8080/get_EVENTS_by_SOLINST", {
        solInstId: solInst.id,
      })
      .then((response) => setSolInstsEvents(response.data));
    console.log(solInstsEvents);
  };

  return (
    <div>
      {solInstsEvents.map((event) => (
        <div key={event.id}>
          <h6>{event}</h6>
        </div>
      ))}
    </div>
  );
};

export default SolInstEvents;
